import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import necessary components from react-router-dom
import Home from './Components/Home/Home';
import Layout from './Components/Layout/Layout';
import About from './Components/About/About';
import Portfolio from './Components/Portfolio/Portfolio';
import Contact from './Components/Contact/Contact';
import Navbar from './Components/Navbar/Navbar';
import Footer from './Components/Footer/Footer';

export default function App() {
  return (
    <Router> {/* Wrap your entire app with the Router component */}
      <Navbar />
      <Layout>
        <Switch> {/* Use Switch to render only one route at a time */}
          <Route path="/home" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/portfolio" component={Portfolio} />
          <Route path="/contact" component={Contact} />
        </Switch>
      </Layout>
      <Footer />
    </Router>
  );
}
